          <a className='instagram' href='https://www.instagram.com/mepe_le_ozen/?igshid=YmMyMTA2M2Y%3D' target="_blank" rel="noreferrer"><img src={instagram} alt="instagram" width="30px"/></a>
          </div>

      </header>

  )
}

export default Navigation
